import React , { Component } from 'react';

class Square extends Component {
  constructor(props) {
    super(props);

  }

  render() {
    return (
      <div style={{width: 80, height: 80, backgroundColor: this.props.color}}>
        { this.props.hasPiece ? <Piece color={this.props.pieceColor == 0 ? "black" : "white" }/> : null}
      </div>
    );
  }

}

export default Square;
